          <div className='content '>
            <h1>{title.rendered}</h1>
            <div className='description'>
              {content.rendered}
            </div>
            <div className='description'>
            <i className='large middle aligned icon calendar' />
            {date.slice(0,10)}
            </div>
          </div>
        </div>
     )    
    }

  }


  render () {

    return (
      <div>
          {this.renderPostView()}
      </div>
    )
  }
}
